var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Home","text":"<p>\u8fd9\u662f\u4e3b\u9875\u7684\u8bf4\u660e\u3002</p>"},{"location":"index.html#welcome-to-mkdocs","title":"Welcome to MkDocs","text":"<p>For full documentation visit mkdocs.org.</p>"},{"location":"index.html#commands","title":"Commands","text":"<ul> <li><code>mkdocs new [dir-name]</code> - Create a new project.</li> <li><code>mkdocs serve</code> - Start the live-reloading docs server.</li> <li><code>mkdocs build</code> - Build the documentation site.</li> <li><code>mkdocs -h</code> - Print help message and exit.</li> </ul>"},{"location":"index.html#project-layout","title":"Project layout","text":"<pre><code>mkdocs.yml    # The configuration file.\ndocs/\n    index.md  # The documentation homepage.\n    ...       # Other markdown pages, images and other files.\n</code></pre>"},{"location":"tag.html","title":"Tag","text":"<p>\u8fd9\u662ftag\u754c\u9762</p>"},{"location":"blog/index.html","title":"\u6211\u7684\u535a\u5ba2","text":"<p>\u6b22\u8fce\u6765\u5230\u6211\u7684\u535a\u5ba2\u9875\u9762\u76ee\u5f55\uff01\u8fd9\u662f\u6211\u8bb0\u5f55\u5404\u79cd\u9879\u76ee\u548c\u6280\u672f\u6587\u7ae0\u7684\u5730\u65b9\u3002</p>"},{"location":"blog/2024/09/19/%E5%AE%9E%E7%94%A8%E7%BD%91%E7%AB%99.html","title":"\u5b9e\u7528\u7f51\u7ad9","text":"<p>\u6536\u5f55\u4e00\u4e9b\u6bd4\u8f83\u5b9e\u7528\u7684\u7f51\u7ad9\u5982\u4e0b\u3002</p> <p>ChatGPT</p>","tags":["\u7f51\u7ad9","\u5b9e\u7528"]},{"location":"develop/markdown.html","title":"\u5feb\u901f\u4e0a\u624bMarkdown\u6307\u5357","text":"<p>Markdown\u4f5c\u4e3a\u5feb\u901f\u7f16\u8f91\uff0c\u5feb\u901f\u7f8e\u5316\u683c\u5f0f\u7684\u8f6f\u4ef6\uff0c\u5e73\u65f6\u7b80\u5355\u8bb0\u70b9\u4e1c\u897f\u8fd8\u662f\u5f88\u6709\u7528\u7684\u3002</p> <p>\u9996\u5148\uff0c\u786e\u4fdd\u5df2\u7ecf\u4e0b\u8f7d\u597d\u4e86 Typora \u8f6f\u4ef6\u3002</p> <p>\u6253\u5f00 Typora \u5219\u6253\u5f00\u4e86\u4e00\u4e2a Markdown \u7f16\u8f91\u5668\uff0c\u4e5f\u53ef\u4ee5\u4f7f\u7528\u65b0\u5efa\u4e00\u4e2a TXT \u6587\u4ef6\u7684\u65b9\u5f0f\uff0c\u7136\u540e\u4f7f\u7528 F2 \u91cd\u547d\u540d\u6587\u4ef6\u4fee\u6539\u540e\u7f00\u4e3a .md </p>"},{"location":"develop/markdown.html#\u6bb5\u843d\u548c\u6362\u884c\u7b26","title":"\u6bb5\u843d\u548c\u6362\u884c\u7b26","text":"<p>\u6bb5\u843d\u53ea\u662f\u4e00\u884c\u6216\u591a\u884c\u8fde\u7eed\u7684\u6587\u672c\u3002\u5728markdown\u6e90\u4ee3\u7801\u4e2d\uff0c\u6bb5\u843d\u7531\u4e24\u4e2a\u6216\u591a\u4e2a\u7a7a\u884c\u5206\u9694\u3002\u5728Typora\u4e2d\uff0c\u53ea\u9700\u8981\u4e00\u4e2a\u7a7a\u884c\uff08\u6309Enter\u4e00\u6b21\uff09\u5373\u53ef\u521b\u5efa\u4e00\u4e2a\u65b0\u6bb5\u843d\u3002\u6309<code>Shift</code>+ Enter\u53ef\u521b\u5efa\u5355\u4e2a\u6362\u884c\u7b26\u3002\u5927\u591a\u6570\u5176\u4ed6\u964d\u4ef7\u89e3\u6790\u5668\u5c06\u5ffd\u7565\u5355\u6362\u884c\u7b26\uff0c\u56e0\u6b64\u4e3a\u4e86\u4f7f\u5176\u4ed6\u964d\u4ef7\u89e3\u6790\u5668\u8bc6\u522b\u6362\u884c\u7b26\uff0c\u60a8\u53ef\u4ee5\u5728\u884c\u7684\u672b\u5c3e\u7559\u4e0b\u4e24\u4e2a\u7a7a\u683c\uff0c\u6216\u8005\u63d2\u5165<code>&lt;br/&gt;</code>\u3002</p>"},{"location":"develop/markdown.html#\u5934--\u6807\u9898","title":"\u5934 | \u6807\u9898","text":"<p>\u6807\u9898<code>#</code>\u5728\u884c\u7684\u5f00\u5934\u4f7f\u75281-6\u4e2ahash\uff08\uff09\u5b57\u7b26\uff0c\u5bf9\u5e94\u4e8e\u6807\u9898\u7ea7\u522b1-6\u3002\u4f8b\u5982\uff1a</p> <p><pre><code># \u8fd9\u662f\u4e00\u7ea7\u6807\u9898 h1\n## \u8fd9\u662f\u4e8c\u7ea7\u6807\u9898 h2\n### \u8fd9\u662f\u4e09\u7ea7\u6807\u9898 h3\n#### \u8fd9\u662f\u56db\u7ea7\u6807\u9898 h4\n##### \u8fd9\u662f\u4e94\u7ea7\u6807\u9898 h5\n###### \u8fd9\u662f\u516d\u7ea7\u6807\u9898 h6\n</code></pre> \u5728Typora\u4e2d\uff0c\u8f93\u5165'\uff03'\u540e\u8ddf\u6807\u9898\u5185\u5bb9\uff0cEnter\u6309\u952e\u5c06\u521b\u5efa\u6807\u9898\u3002</p>"},{"location":"develop/markdown.html#\u6bb5\u843d","title":"\u6bb5\u843d","text":"<p>Markdown \u6bb5\u843d\u6ca1\u6709\u7279\u6b8a\u7684\u683c\u5f0f\uff0c\u76f4\u63a5\u7f16\u5199\u6587\u5b57\u5c31\u597d\uff0c\u6bb5\u843d\u7684\u6362\u884c\u662f\u4f7f\u7528\u4e24\u4e2a\u4ee5\u4e0a\u7a7a\u683c\u52a0\u4e0a\u56de\u8f66\u3002</p>"},{"location":"develop/markdown.html#\u5b57\u4f53","title":"\u5b57\u4f53","text":"<p>Markdown \u53ef\u4ee5\u4f7f\u7528\u4ee5\u4e0b\u51e0\u79cd\u5b57\u4f53\uff1a <pre><code>*\u659c\u4f53\u6587\u672c*\n_\u659c\u4f53\u6587\u672c_\n**\u7c97\u4f53\u6587\u672c**\n__\u7c97\u4f53\u6587\u672c__\n***\u7c97\u659c\u4f53\u6587\u672c***\n___\u7c97\u659c\u4f53\u6587\u672c___\n</code></pre> \u6e32\u67d3\u7ed3\u679c\u5982\u4e0b\uff1a \u659c\u4f53\u6587\u672c \u659c\u4f53\u6587\u672c \u7c97\u4f53\u6587\u672c \u7c97\u4f53\u6587\u672c \u7c97\u659c\u4f53\u6587\u672c \u7c97\u659c\u4f53\u6587\u672c</p>"},{"location":"develop/markdown.html#\u5206\u5272\u7ebf","title":"\u5206\u5272\u7ebf","text":"<p>\u4f60\u53ef\u4ee5\u5728\u4e00\u884c\u4e2d\u7528\u4e09\u4e2a\u4ee5\u4e0a\u7684\u661f\u53f7\u3001\u51cf\u53f7\u3001\u5e95\u7ebf\u6765\u5efa\u7acb\u4e00\u4e2a\u5206\u9694\u7ebf\uff0c\u884c\u5185\u4e0d\u80fd\u6709\u5176\u4ed6\u4e1c\u897f\u3002\u4f60\u4e5f\u53ef\u4ee5\u5728\u661f\u53f7\u6216\u662f\u51cf\u53f7\u4e2d\u95f4\u63d2\u5165\u7a7a\u683c\u3002\u4e0b\u9762\u6bcf\u79cd\u5199\u6cd5\u90fd\u53ef\u4ee5\u5efa\u7acb\u5206\u9694\u7ebf\uff1a</p> <pre><code>***\n* * *\n\n*****\n\n- - -\n\n----------\n</code></pre> <p>\u6e32\u67d3\u7ed3\u679c\u5982\u4e0b\uff1a</p>"},{"location":"develop/markdown.html#\u5220\u9664\u7ebf","title":"\u5220\u9664\u7ebf","text":"<p>\u5982\u679c\u6bb5\u843d\u4e0a\u7684\u6587\u5b57\u8981\u6dfb\u52a0\u5220\u9664\u7ebf\uff0c\u53ea\u9700\u8981\u5728\u6587\u5b57\u7684\u4e24\u7aef\u52a0\u4e0a\u4e24\u4e2a\u6ce2\u6d6a\u7ebf ~~ \u5373\u53ef\uff0c\u5b9e\u4f8b\u5982\u4e0b\uff1a</p> <pre><code>baidu.com\ngoogle.com\n~~taobao.com~~\n</code></pre> <p>\u6e32\u67d3\u7ed3\u679c\u5982\u4e0b\uff1a</p> <p>baidu.com google.com taobao.com</p>"},{"location":"develop/markdown.html#\u4e0b\u5212\u7ebf","title":"\u4e0b\u5212\u7ebf","text":"<p>\u4e0b\u5212\u7ebf\u53ef\u4ee5\u901a\u8fc7 HTML \u7684 <code>&lt;u&gt;</code> \u6807\u7b7e\u6765\u5b9e\u73b0\uff1a</p> <pre><code>&lt;u&gt;\u5e26\u4e0b\u5212\u7ebf\u6587\u672c&lt;/u&gt;\n</code></pre>"},{"location":"develop/markdown.html#\u5217\u8868","title":"\u5217\u8868","text":"<p>Markdown \u652f\u6301\u6709\u5e8f\u5217\u8868\u548c\u65e0\u5e8f\u5217\u8868\u3002</p> <p>\u65e0\u5e8f\u5217\u8868\u4f7f\u7528\u661f\u53f7(*)\u3001\u52a0\u53f7(+)\u6216\u662f\u51cf\u53f7(-**)\u4f5c\u4e3a\u5217\u8868\u6807\u8bb0\uff1a</p> <pre><code>* \u7b2c\u4e00\u9879\n* \u7b2c\u4e8c\u9879\n* \u7b2c\u4e09\u9879\n\n+ \u7b2c\u4e00\u9879\n+ \u7b2c\u4e8c\u9879\n+ \u7b2c\u4e09\u9879\n\n\n- \u7b2c\u4e00\u9879\n- \u7b2c\u4e8c\u9879\n- \u7b2c\u4e09\u9879\n</code></pre> <p>\u6709\u5e8f\u5217\u8868\u4f7f\u7528\u6570\u5b57\u5e76\u52a0\u4e0a . \u53f7\u6765\u8868\u793a\uff0c\u5982\uff1a</p> <pre><code>1. \u7b2c\u4e00\u9879\n2. \u7b2c\u4e8c\u9879\n3. \u7b2c\u4e09\u9879\n</code></pre>"},{"location":"develop/markdown.html#\u5217\u8868\u5d4c\u5957","title":"\u5217\u8868\u5d4c\u5957","text":"<p>\u5217\u8868\u5d4c\u5957\u53ea\u9700\u5728\u5b50\u5217\u8868\u4e2d\u7684\u9009\u9879\u6dfb\u52a0\u56db\u4e2a\u7a7a\u683c\u6216Tab\u5373\u53ef\uff1a</p> <pre><code>1. \u7b2c\u4e00\u9879\uff1a\n   - \u7b2c\u4e00\u9879\u5d4c\u5957\u7684\u7b2c\u4e00\u4e2a\u5143\u7d20\n   - \u7b2c\u4e00\u9879\u5d4c\u5957\u7684\u7b2c\u4e8c\u4e2a\u5143\u7d20\n\n2. \u7b2c\u4e8c\u9879\uff1a\n   - \u7b2c\u4e8c\u9879\u5d4c\u5957\u7684\u7b2c\u4e00\u4e2a\u5143\u7d20\n   - \u7b2c\u4e8c\u9879\u5d4c\u5957\u7684\u7b2c\u4e00\u4e2a\u5143\u7d20\n</code></pre> <p>\u533a\u5757</p> <p>Markdown \u533a\u5757\u5f15\u7528\u662f\u5728\u6bb5\u843d\u5f00\u5934\u4f7f\u7528 &gt; \u7b26\u53f7 \uff0c\u7136\u540e\u540e\u9762\u7d27\u8ddf\u4e00\u4e2a\u7a7a\u683c\u7b26\u53f7\uff1a</p> <pre><code>&gt; Markdown \u6559\u7a0b\n&gt; caiya\n&gt; 234567\n</code></pre> <p>\u53e6\u5916\u533a\u5757\u662f\u53ef\u4ee5\u5d4c\u5957\u7684\uff0c\u4e00\u4e2a &gt; \u7b26\u53f7\u662f\u6700\u5916\u5c42\uff0c\u4e24\u4e2a &gt; \u7b26\u53f7\u662f\u7b2c\u4e00\u5c42\u5d4c\u5957\uff0c\u4ee5\u6b64\u7c7b\u63a8\uff1a</p> <pre><code>&gt; \u6700\u5916\u5c42\n&gt; &gt; \u7b2c\u4e00\u5c42\u5d4c\u5957\n&gt; &gt; &gt; \u7b2c\u4e8c\u5c42\u5d4c\u5957\n</code></pre> <p>\u533a\u5757\u4e2d\u4f7f\u7528\u5217\u8868</p> <p>\u533a\u5757\u4e2d\u4f7f\u7528\u5217\u8868\u5b9e\u4f8b\u5982\u4e0b\uff1a</p> <p>\u4ee3\u7801\u8bed\u8a00\uff1ajavascript</p> <p>\u590d\u5236</p> <pre><code>&gt; \u533a\u5757\u4e2d\u4f7f\u7528\u5217\u8868\n&gt;&gt; 1. \u7b2c\u4e00\u9879&gt; 2. \u7b2c\u4e8c\u9879&gt;&gt; - \u7b2c\u4e00\u9879&gt; - \u7b2c\u4e8c\u9879&gt; - \u7b2c\u4e09\u9879\n</code></pre> <p>\u663e\u793a\u7ed3\u679c\u5982\u4e0b\uff1a</p> <p>\u533a\u5757\u4e2d\u4f7f\u7528\u5217\u8868</p> <ol> <li>\u7b2c\u4e00\u9879</li> <li> <p>\u7b2c\u4e8c\u9879 </p> </li> <li> <p>\u7b2c\u4e00\u9879</p> </li> <li>\u7b2c\u4e8c\u9879</li> <li>\u7b2c\u4e09\u9879</li> </ol>"},{"location":"develop/markdown.html#\u5217\u8868\u4e2d\u4f7f\u7528\u533a\u5757","title":"\u5217\u8868\u4e2d\u4f7f\u7528\u533a\u5757","text":"<p>\u5982\u679c\u8981\u5728\u5217\u8868\u9879\u76ee\u5185\u653e\u8fdb\u533a\u5757\uff0c\u90a3\u4e48\u5c31\u9700\u8981\u5728 &gt; \u524d\u6dfb\u52a0\u56db\u4e2a\u7a7a\u683c\u7684\u7f29\u8fdb\u3002</p> <p>\u533a\u5757\u4e2d\u4f7f\u7528\u5217\u8868\u5b9e\u4f8b\u5982\u4e0b\uff1a</p> <p>\u4ee3\u7801\u8bed\u8a00\uff1ajavascript</p> <p>\u590d\u5236</p> <pre><code>- \u7b2c\u4e00\u9879\n  &gt; \u3010754767\u3011  &gt; caiy\n- \u7b2c\u4e8c\u9879\n</code></pre> <p>\u663e\u793a\u6548\u679c\u5982\u4e0b\uff1a</p> <ul> <li>\u7b2c\u4e00\u9879</li> </ul> <p>\u3010754767\u3011  </p> <p>caiy</p> <ul> <li>\u7b2c\u4e8c\u9879</li> </ul>"},{"location":"develop/markdown.html#\u94fe\u63a5","title":"\u94fe\u63a5","text":"<p>\u94fe\u63a5\u4f7f\u7528\u65b9\u6cd5\u5982\u4e0b\uff1a</p> <pre><code>[\u94fe\u63a5\u540d\u79f0](\u94fe\u63a5\u5730\u5740)\n\u6216\u8005\n&lt;\u94fe\u63a5\u5730\u5740&gt;\n</code></pre> <p>\u5982\u4e0b\u9762\u8fd9\u4e2a\u4f8b\u5b50\uff1a</p> <pre><code>\u8fd9\u662f\u4e00\u4e2a\u94fe\u63a5 [\u767e\u5ea6\u94fe\u63a5](https://www.baidu.com)\n</code></pre> <p>\u6e32\u67d3\u7ed3\u679c\u5982\u4e0b\uff1a</p> <p>\u8fd9\u662f\u4e00\u4e2a\u94fe\u63a5 \u767e\u5ea6\u94fe\u63a5</p>"},{"location":"develop/markdown.html#\u56fe\u7247","title":"\u56fe\u7247","text":"<p>Markdown \u56fe\u7247\u8bed\u6cd5\u683c\u5f0f\u5982\u4e0b\uff1a</p> <pre><code>![alt \u5c5e\u6027\u6587\u672c](\u56fe\u7247\u5730\u5740)\n\n![alt \u5c5e\u6027\u6587\u672c](\u56fe\u7247\u5730\u5740 \"\u53ef\u9009\u6807\u9898\")\n</code></pre> <ul> <li>\u5f00\u5934\u4e00\u4e2a\u611f\u53f9\u53f7 !</li> <li>\u63a5\u7740\u4e00\u4e2a\u65b9\u62ec\u53f7\uff0c\u91cc\u9762\u653e\u4e0a\u56fe\u7247\u7684\u66ff\u4ee3\u6587\u5b57</li> <li>\u63a5\u7740\u4e00\u4e2a\u666e\u901a\u62ec\u53f7\uff0c\u91cc\u9762\u653e\u4e0a\u56fe\u7247\u7684\u7f51\u5740\uff0c\u6700\u540e\u8fd8\u53ef\u4ee5\u7528\u5f15\u53f7\u5305\u4f4f\u5e76\u52a0\u4e0a\u9009\u62e9\u6027\u7684 'title' \u5c5e\u6027\u7684\u6587\u5b57\u3002</li> </ul> <p>\u4f7f\u7528\u5b9e\u4f8b\uff1a</p> <pre><code>![baidu \u56fe\u6807](https://www.baidu.com/img/bd_logo1.png )\n![baidu \u56fe\u6807](https://www.baidu.com/img/bd_logo1.png  \"baidu\")\n</code></pre> <p>\u663e\u793a\u7ed3\u679c\u5982\u4e0b\uff1a</p> <p></p>"},{"location":"develop/markdown.html#\u8868\u683c","title":"\u8868\u683c","text":"<p>Markdown \u5236\u4f5c\u8868\u683c\u4f7f\u7528 | \u6765\u5206\u9694\u4e0d\u540c\u7684\u5355\u5143\u683c\uff0c\u4f7f\u7528 - \u6765\u5206\u9694\u8868\u5934\u548c\u5176\u4ed6\u884c\u3002</p> <p>\u8bed\u6cd5\u683c\u5f0f\u5982\u4e0b\uff1a</p> <pre><code>| \u8868\u5934   | \u8868\u5934   |\n| ------ | ------ |\n| \u5355\u5143\u683c | \u5355\u5143\u683c |\n| \u5355\u5143\u683c | \u5355\u5143\u683c |\n</code></pre> <p>\u663e\u793a\u6548\u679c\u5982\u4e0b\uff1a</p> \u8868\u5934 \u8868\u5934 \u5355\u5143\u683c \u5355\u5143\u683c \u5355\u5143\u683c \u5355\u5143\u683c <p>\u5bf9\u9f50\u65b9\u5f0f</p> <p>\u6211\u4eec\u53ef\u4ee5\u8bbe\u7f6e\u8868\u683c\u7684\u5bf9\u9f50\u65b9\u5f0f\uff1a</p> <ul> <li>-: \u8bbe\u7f6e\u5185\u5bb9\u548c\u6807\u9898\u680f\u5c45\u53f3\u5bf9\u9f50\u3002</li> <li>:- \u8bbe\u7f6e\u5185\u5bb9\u548c\u6807\u9898\u680f\u5c45\u5de6\u5bf9\u9f50\u3002</li> <li>:-: \u8bbe\u7f6e\u5185\u5bb9\u548c\u6807\u9898\u680f\u5c45\u4e2d\u5bf9\u9f50\u3002</li> </ul> <p>\u5b9e\u4f8b\u5982\u4e0b\uff1a</p> <pre><code>| \u5de6\u5bf9\u9f50 | \u53f3\u5bf9\u9f50 | \u5c45\u4e2d\u5bf9\u9f50 |\n| :----- | -----: | :------: |\n| \u5355\u5143\u683c | \u5355\u5143\u683c |  \u5355\u5143\u683c  |\n| \u5355\u5143\u683c | \u5355\u5143\u683c |  \u5355\u5143\u683c  |\n</code></pre> <p>\u663e\u793a\u6548\u679c\u5982\u4e0b\uff1a</p> \u5de6\u5bf9\u9f50 \u53f3\u5bf9\u9f50 \u5c45\u4e2d\u5bf9\u9f50 \u5355\u5143\u683c \u5355\u5143\u683c \u5355\u5143\u683c \u5355\u5143\u683c \u5355\u5143\u683c \u5355\u5143\u683c"},{"location":"blog/archive/2024.html","title":"2024","text":""}]}